import React from "react";

const NavItems = () => {
  return(
    <div>
      <a className="text-white" href="#">About</a>
      <a className="text-white" href="#">Services</a>
      <a className="text-white" href="#">Projects</a>

      <div className="hover:opacity-50 hover:text-opacity-0">
        <button className="text-sm text-gray-900 bg-white hover:text-white font-bold py-3 rounded-full px-7">CONTACT</button> 
      </div>
    </div>
  )
}  
export default NavItems
